import { useState } from "react";
import "./ExpenseForm.css"
import Expenses from "./Expenses";

function ExpenseForm(){
      var [date, setDate] = useState("");
      var [title, setTitle] = useState("");
      var [project, setProject] = useState("");

      function datechange(event){
         setDate(event.target.value);
      }
      function titlechange(event){
        setTitle(event.target.value);
     }
     function projectchange(event){
        setProject(event.target.value);
     }

     function submit(){
        <Expenses
        title = {title} date ={date} pro={project}>
        </Expenses>
     }

    return <div>
        <div className="form">
            <label>date</label>
            <input type="date" onChange={datechange} ></input>
        </div>
        <div className="form">
            <label>title</label>
            <input type="text" onChange={titlechange} ></input>
        </div>
        <div className="form">
            <label>project name</label>
            <input type="text" onChange={projectchange} ></input>
        </div>
        <button onClick={submit}>submit</button>
     </div>
}

export default ExpenseForm;
